description: "```\n\nThis is a readme file for the models associated with the paper:\n\
  \nYen-Ching Liu et al., The mechanisms of propofol-induced block on ion\ncurrents\
  \ in differentiated H9c2 cardiac cells.\nEur. J. Pharmacol. 2008;590: 93-98.\n\n\
  Abstract: General anesthetic propofol (2,6-bis(isopropyl)-phenol)\npossess a chemical\
  \ structure unrelated to other anesthetic drugs. It\nhas been known to block a variety\
  \ of ion currents. This study is\ndesigned to determine the effect of this drug\
  \ on ion currents in\ndifferentiated H9c2 cardiac cells. The effects of propofol,\
  \ an\nintravenous anesthetic agent with a distinct chemical structure, on\nion currents\
  \ of differentiated clonal cardiac (H9c2) cells were\ninvestigated in this study.\
  \ Propofol (10-300 muM) suppressed the\namplitude of delayed rectifier K(+) current\
  \ (I(K(DR))) in a\nconcentration-dependent manner with an IC(50) value of 36 muM.\
  \ This\ncompound reduced activation time constant and increased current\ninactivation,\
  \ although no voltage dependency of propofol-induced block\nof I(K(DR)) can demonstrated.\
  \ Neither diazoxide, pinacidil, nor\ncaffeic acid phenethyl ester had any effect\
  \ on propofol-induced block\nof I(K(DR)). Propofol (30 muM) had no effect on erg-mediated\
  \ K(+)\ncurrent in these cells; however, it suppressed L-type Ca(2+) current\n(I(Ca,L))\
  \ of cardiac and skeletal types to a similar\nextent. Intracellular dialysis with\
  \ propofol (100 muM) had no effects\non I(K(DR)) or I(Ca,L). Numerical simulations\
  \ of I(K(DR)) based on a\nMarkovian model reproduce the experimental results and\
  \ show that\npropofol-induced blockade of I(K(DR)) is associated with an decrease\n\
  in forward rate of the activation process and an increase in\ntransitional rate\
  \ into the inactivated state. Propofol can suppress\nI(K(DR)) in differentiated\
  \ H9c2 cardiac cells in a concentration- and\nstate- dependent manner. These effects\
  \ can significantly contribute\nits action on functional activity of heart cells.\n\
  \n\nTo run the models:\n\nXPP: start with the command\nxpp IK\\_Prop.ode\nMouse\
  \ click on \"Initialconds\", and then \"(G)o\".\n\nRegarding xpp program, please\
  \ contact with Bard Ermentrout's website: \n http://www.pitt.edu/~phase/ \nHere\
  \ describes the details in how to get and use xpp.\n\nTo run a series of voltage-clamp\
  \ studies shown in IK-prop.jpg, click\nInitialconds -> Range, then under \"Range\
  \ over\", change to 'vtest\\_1',\nand then select voltage protocol from Steps (4),\
  \ Start (10) and End\n(+50). Change Cycle Color to yes and press (G)o, This makes\
  \ traces:\n\n\n```\n![screenshot](data:image/jpeg;base64,)\n\
  ```\n\n\nThe model file was supplied by:\n\nDr. Sheng-Nan Wu\nNational Cheng Kung\
  \ University Medical College\nTainan 70101, Taiwan\nsnwu@mail.ncku.edu.tw\n\n```"
